import "./App.css";
import { useState } from "react";

function App() {
  const [age, setAge] = useState(0);
  const increaseAge = (age) => {
    setAge(age + 1);
  };

  return (
    <div className="App">
      <p>{age}</p>
      <button onClick={increaseAge(age)}>increase</button>
    </div>
  );
}

export default App;
